import React from 'react';
import { BrowserRouter as NavLink, } from 'react-router-dom';

const Home = () => <h2>Home</h2>;
const Introduction = () => <h2>Introduction</h2>;
const Variables = () => <h2>Variables and Data Types</h2>;
const Operators = () => <h2>Operators and Expressions</h2>;
const Conditionals = () => <h2>Conditional Statements</h2>;
const Loops = () => <h2>Loops</h2>;
const Functions = () => <h2>Functions</h2>;
const Modules = () => <h2>Modules and Packages</h2>;
const Strings = () => <h2>Strings</h2>;
const Lists = () => <h2>Lists and Tuples</h2>;
const Dictionaries = () => <h2>Dictionaries and Sets</h2>;
const FileIO = () => <h2>File Input/Output</h2>;
const Exceptions = () => <h2>Exceptions</h2>;
const Libraries = () => <h2>Core Libraries</h2>;
const OOP = () => <h2>Object-Oriented Programming</h2>;
const AdvancedOOP = () => <h2>Advanced OOP</h2>;
const Web = () => <h2>Web Development</h2>;
const Databases = () => <h2>Database Handling</h2>;
const Project = () => <h2>Final Project</h2>;
const Resources = () => <h2>Additional Resources</h2>;
const Links = () => <h2>Useful Links</h2>;

const App = () => {
  return (
      <nav>
        <ul>
          <li>
            <NavLink to="/" end>Home</NavLink>
          </li>
          <li>
            <NavLink to="/introduction">Introduction</NavLink>
          </li>
          <li>
            <NavLink to="/variables">Variables and Data Types</NavLink>
          </li>
          <li>
            <NavLink to="/operators">Operators and Expressions</NavLink>
          </li>
          <li>
            <NavLink to="/conditionals">Conditional Statements</NavLink>
          </li>
          <li>
            <NavLink to="/loops">Loops</NavLink>
          </li>
          <li>
            <NavLink to="/functions">Functions</NavLink>
          </li>
          <li>
            <NavLink to="/modules">Modules and Packages</NavLink>
          </li>
          <li>
            <NavLink to="/strings">Strings</NavLink>
          </li>
          <li>
            <NavLink to="/lists">Lists and Tuples</NavLink>
          </li>
          <li>
            <NavLink to="/dictionaries">Dictionaries and Sets</NavLink>
          </li>
          <li>
            <NavLink to="/file-io">File Input/Output</NavLink>
          </li>
          <li>
            <NavLink to="/exceptions">Exceptions</NavLink>
          </li>
          <li>
            <NavLink to="/libraries">Core Libraries</NavLink>
          </li>
          <li>
            <NavLink to="/oop">Object-Oriented Programming</NavLink>
          </li>
          <li>
            <NavLink to="/advanced-oop">Advanced OOP</NavLink>
          </li>
          <li>
            <NavLink to="/web">Web Development</NavLink>
          </li>
          <li>
            <NavLink to="/databases">Database Handling</NavLink>
          </li>
          <li>
            <NavLink to="/project">Final Project</NavLink>
          </li>
          <li>
            <NavLink to="/resources">Additional Resources</NavLink>
          </li>
          <li>
            <NavLink to="/links">Useful Links</NavLink>
          </li>
        </ul>
      </nav>
  );
}

export default App;
